// components/Marquee.js
import React from 'react';
import './Marquee.css';

function Marquee() {
  return (
    <div className="marquee-container">
      <p className="marquee-text">
        NDRF Helpline Number: 1234-567-890 | For Immediate Assistance, Call Now!
      </p>
    </div>
  );
}

export default Marquee;
